import { Fragment } from "react";
import React from "react";
import Navbar from "./Navbar";
function Cart() {
  return (
    <Fragment>
      <div>
        <Navbar></Navbar>
      </div>
      <div>
        <section class="about" id="about">
          <h1 class="heading">
            {" "}
            <span> about </span> us{" "}
          </h1>
        </section>
      </div>
    </Fragment>
  );
}

export default Cart;
